import React, {Component} from 'react';
import {Helmet} from 'react-helmet';
import ProjectCard from '../components/projectCard';


const title = "Projects|Alper Tunca";
/*
 Card ların yer aldıgı div düzenlenecek
 */


class Projects extends Component {
    render() {
        const divStyle = {
            width: "100%",
            background: "#1F1E1A"
        };

        const colorStyle = {
            color: "#34A4EB"
        };


        return (
            <div style={divStyle} className="mt-3">
                <Helmet>
                    <title>{title}</title>
                </Helmet>
                <h1 style={colorStyle}>PROJECTS</h1>
                <p style={{color : "#FFFFFF" }}>My projects are here, you can open github for more</p>

                <div className="ml-4 mr-4 mt-2">
                    <ProjectCard border="#00ff00" cardHeader="Project #1" imgURL="../robot-arm.png" info="Robot Arm"/>
                    <br/>
                    <ProjectCard border="warning" cardHeader="Project #2" imgURL="./cansat-circuit.jpg" info = "Cansat Circuit"/>
                </div>

            </div>
        );
    }
}

export default Projects;
